import Expenseitem from "./components/ExpenseItem";

function App() {
  const expense = [
    {
      id: "0",
      title: "named",
      amount: "23.5",
      date: new Date(1987, 4, 26),
    },
    {
      id: "1",
      title: "named",
      amount: "23.5",
      date: new Date(1987, 4, 26),
    },
    {
      id: "2",
      title: "named",
      amount: "23.5",
      date: new Date(1987, 4, 26),
    },
  ];
  return (
    <Expenseitem
      title={expense[0].title}
      amount={expense.amount}
      date={expense.date}
    />
  );
}

export default App;
